-- Drop tables in correct dependency order
DROP TABLE USERS CASCADE CONSTRAINTS;
DROP TABLE CUSTOMER_NOTIFICATION CASCADE CONSTRAINTS;
DROP TABLE NOTIFICATION CASCADE CONSTRAINTS;
DROP TABLE DELIVERY CASCADE CONSTRAINTS;
DROP TABLE ORDER_PAYMENT CASCADE CONSTRAINTS;
DROP TABLE PAYMENT CASCADE CONSTRAINTS;
DROP TABLE ORDERITEM CASCADE CONSTRAINTS;
DROP TABLE ORDERS CASCADE CONSTRAINTS;
DROP TABLE OFFER_PRODUCT CASCADE CONSTRAINTS;
DROP TABLE PRODUCT CASCADE CONSTRAINTS;
DROP TABLE MENU CASCADE CONSTRAINTS;
DROP TABLE OFFER CASCADE CONSTRAINTS;
DROP TABLE RETURNPOLICY CASCADE CONSTRAINTS;
DROP TABLE RESTAURANT CASCADE CONSTRAINTS;
DROP TABLE BRANCH_2 CASCADE CONSTRAINTS;
DROP TABLE BRANCH_1 CASCADE CONSTRAINTS;
DROP TABLE LOCATION CASCADE CONSTRAINTS;
DROP TABLE DELIVERY_MAN CASCADE CONSTRAINTS;
DROP TABLE R_MANAGER CASCADE CONSTRAINTS;
DROP TABLE EMPLOYEE CASCADE CONSTRAINTS;
DROP TABLE DISCOUNT CASCADE CONSTRAINTS;
DROP TABLE CUSTOMER CASCADE CONSTRAINTS;
DROP TABLE USER_ CASCADE CONSTRAINTS;

-- Now recreating the tables
--
  CREATE TABLE USERS 
   (	USER_ID INT NOT NULL, 
	USER_NAME VARCHAR2(100) NOT NULL, 
	USER_PASS VARCHAR2(100) NOT NULL, 
	USER_ROLL VARCHAR2(100) NOT NULL, 
	USER_ACTIVATED NUMBER DEFAULT 0, 
	 PRIMARY KEY (USER_ID)
   ) ;

-- 1. USER_
CREATE TABLE USER_ (
    User_ID NUMBER PRIMARY KEY,
    User_Name VARCHAR2(100) NOT NULL,
    User_P_Number VARCHAR2(20)
);

-- 2. LOCATION
CREATE TABLE LOCATION (
    Location_ID NUMBER PRIMARY KEY,
    Area VARCHAR2(100) NOT NULL,
    City VARCHAR2(100),
    Postal_Code VARCHAR2(20)
);

-- 3. BRANCH_1
CREATE TABLE BRANCH_1 (
    Branch_ID NUMBER PRIMARY KEY,
    Branch_Name VARCHAR2(100) NOT NULL,
    Area VARCHAR2(100) NOT NULL,
    Available_hour NUMBER NOT NULL
);

-- 4. BRANCH_2
CREATE TABLE BRANCH_2 (
    Branch_ID NUMBER PRIMARY KEY,
    Branch_Name VARCHAR2(100) NOT NULL,
    City VARCHAR2(100) NOT NULL,
    Area VARCHAR2(100) NOT NULL,
    Location_ID NUMBER NOT NULL,
    CONSTRAINT fk_branch2_location FOREIGN KEY (Location_ID) REFERENCES LOCATION(Location_ID)
);

-- 5. NOTIFICATION
CREATE TABLE NOTIFICATION (
    NotificationID NUMBER PRIMARY KEY,
    NotificationName VARCHAR2(100) NOT NULL,
    NotificationType VARCHAR2(50) NOT NULL
);

-- 6. CUSTOMER
CREATE TABLE CUSTOMER (
    Cust_ID NUMBER PRIMARY KEY,
    Address VARCHAR2(200),
    Bill NUMBER(10,2),
    NotificationID NUMBER NOT NULL,
    User_ID NUMBER,
    CONSTRAINT fk_customer_notification FOREIGN KEY (NotificationID) REFERENCES NOTIFICATION(NotificationID),
    CONSTRAINT fk_customer_user FOREIGN KEY (User_ID) REFERENCES USER_(User_ID)
);

-- 7. DISCOUNT
CREATE TABLE DISCOUNT (
    Dis_Name VARCHAR2(100) PRIMARY KEY,
    Dis_Type VARCHAR2(50),
    Dis_Amount NUMBER(10,2)
);

-- 8. RETURNPOLICY
CREATE TABLE RETURNPOLICY (
    PolicyID NUMBER PRIMARY KEY,
    PolicyDetails VARCHAR2(200),
    ReturnType VARCHAR2(50),
    ReturnTime VARCHAR2(50)
);

-- 9. OFFER
CREATE TABLE OFFER (
    OfferName VARCHAR2(100) PRIMARY KEY,
    OfferType VARCHAR2(50),
    OfferAmount NUMBER(10,2)
);

-- 10. RESTAURANT
CREATE TABLE RESTAURANT (
    Restaurant_ID NUMBER PRIMARY KEY,
    Restaurant_Name VARCHAR2(100) NOT NULL,
    Owner_Name VARCHAR2(100),
    Opening_hours VARCHAR2(50),
    R_Rating NUMBER(3,2),
    Branch_ID NUMBER NOT NULL,
    LocationID NUMBER,
    CONSTRAINT fk_restaurant_branch2 FOREIGN KEY (Branch_ID) REFERENCES BRANCH_2(Branch_ID),
    CONSTRAINT fk_restaurant_location FOREIGN KEY (LocationID) REFERENCES LOCATION(Location_ID)
);

-- 11. MENU
CREATE TABLE MENU (
    Menu_ID NUMBER PRIMARY KEY,
    Menu_Name VARCHAR2(100) NOT NULL,
    Category VARCHAR2(50),
    Restaurant_ID NUMBER NOT NULL,
    CONSTRAINT fk_menu_restaurant FOREIGN KEY (Restaurant_ID) REFERENCES RESTAURANT(Restaurant_ID)
);

-- 12. PRODUCT
CREATE TABLE PRODUCT (
    Product_ID NUMBER PRIMARY KEY,
    Product_Name VARCHAR2(100) NOT NULL,
    Price NUMBER(10,2) NOT NULL,
    Category VARCHAR2(100),
    Menu_ID NUMBER,
    OfferName VARCHAR2(100),
    CONSTRAINT fk_product_menu FOREIGN KEY (Menu_ID) REFERENCES MENU(Menu_ID),
    CONSTRAINT fk_product_offer FOREIGN KEY (OfferName) REFERENCES OFFER(OfferName)
);

-- 13. EMPLOYEE
CREATE TABLE EMPLOYEE (
    Emp_ID NUMBER PRIMARY KEY,
    Joining_Date DATE NOT NULL,
    Salary NUMBER(10,2),
    Position VARCHAR2(50),
    Working_hour NUMBER,
    Available_hour NUMBER,
    Branch_ID NUMBER NOT NULL,
    User_ID NUMBER,
    CONSTRAINT fk_emp_user FOREIGN KEY (User_ID) REFERENCES USER_(User_ID),
    CONSTRAINT fk_emp_branch FOREIGN KEY (Branch_ID) REFERENCES BRANCH_1(Branch_ID)
);

-- 14. R_MANAGER
CREATE TABLE R_MANAGER (
    Emp_ID NUMBER PRIMARY KEY,
    Responsibility VARCHAR2(100),
    Shift_Time VARCHAR2(50),
    CONSTRAINT fk_rm_emp FOREIGN KEY (Emp_ID) REFERENCES EMPLOYEE(Emp_ID)
);

-- 15. DELIVERY_MAN
CREATE TABLE DELIVERY_MAN (
    Emp_ID NUMBER PRIMARY KEY,
    Rating NUMBER(3,2),
    Avg_Delivery_Time NUMBER,
    CONSTRAINT fk_dm_emp FOREIGN KEY (Emp_ID) REFERENCES EMPLOYEE(Emp_ID)
);

-- 16. OFFER_PRODUCT
CREATE TABLE OFFER_PRODUCT (
    OfferName VARCHAR2(100),
    Product_ID NUMBER,
    OfferType VARCHAR2(50),
    OfferAmount NUMBER(10,2),
    CONSTRAINT pk_offer_product PRIMARY KEY (OfferName, Product_ID),
    CONSTRAINT fk_op_offer FOREIGN KEY (OfferName) REFERENCES OFFER(OfferName),
    CONSTRAINT fk_op_product FOREIGN KEY (Product_ID) REFERENCES PRODUCT(Product_ID)
);

-- 17. ORDERS
CREATE TABLE ORDERS (
    Order_ID NUMBER PRIMARY KEY,
    Order_Status VARCHAR2(50) NOT NULL,
    Total_Amount NUMBER(10,2),
    Dis_Name VARCHAR2(100),
    Payment_Status VARCHAR2(50) NOT NULL,
    PolicyID NUMBER,
    Cust_ID NUMBER NOT NULL,
    CONSTRAINT fk_order_discount FOREIGN KEY (Dis_Name) REFERENCES DISCOUNT(Dis_Name),
    CONSTRAINT fk_order_customer FOREIGN KEY (Cust_ID) REFERENCES CUSTOMER(Cust_ID)
);

-- 18. ORDERITEM
CREATE TABLE ORDERITEM (
    OrderItem_ID NUMBER PRIMARY KEY,
    Quantity NUMBER NOT NULL,
    Total_Price NUMBER(10,2),
    OfferAmount NUMBER(10,2),
    Order_ID NUMBER NOT NULL,
    Product_ID NUMBER NOT NULL,
    CONSTRAINT fk_oi_order FOREIGN KEY (Order_ID) REFERENCES ORDERS(Order_ID),
    CONSTRAINT fk_oi_product FOREIGN KEY (Product_ID) REFERENCES PRODUCT(Product_ID)
);

-- 19. PAYMENT
CREATE TABLE PAYMENT (
    PaymentID NUMBER PRIMARY KEY,
    PayID VARCHAR2(100),
    Method VARCHAR2(50),
    Status VARCHAR2(50),
    Phone VARCHAR2(20)
);

-- 20. ORDER_PAYMENT
CREATE TABLE ORDER_PAYMENT (
    Order_ID NUMBER,
    PaymentID NUMBER,
    CONSTRAINT pk_order_payment PRIMARY KEY (Order_ID, PaymentID),
    CONSTRAINT fk_order FOREIGN KEY (Order_ID) REFERENCES ORDERS(Order_ID),
    CONSTRAINT fk_payment FOREIGN KEY (PaymentID) REFERENCES PAYMENT(PaymentID)
);

-- 21. DELIVERY
CREATE TABLE DELIVERY (
    DeliveryID NUMBER PRIMARY KEY,
    DeliveryType VARCHAR2(50),
    OfferAmount NUMBER(10,2),
    Branch_ID NUMBER NOT NULL,
    CONSTRAINT fk_delivery_branch FOREIGN KEY (Branch_ID) REFERENCES BRANCH_1(Branch_ID)
);

-- 22. CUSTOMER_NOTIFICATION
CREATE TABLE CUSTOMER_NOTIFICATION (
    Cust_ID NUMBER NOT NULL,
    NotificationID NUMBER NOT NULL,
    SentAt DATE NOT NULL,
    ReadStatus CHAR(1) NOT NULL CHECK (ReadStatus IN ('Y', 'N')),
    ReadAt DATE,
    ActionTaken VARCHAR2(100),
    CONSTRAINT pk_cust_notif PRIMARY KEY (Cust_ID, NotificationID),
    CONSTRAINT fk_cust_notif_cust FOREIGN KEY (Cust_ID) REFERENCES CUSTOMER(Cust_ID),
    CONSTRAINT fk_cust_notif_not FOREIGN KEY (NotificationID) REFERENCES NOTIFICATION(NotificationID)
);


