CREATE OR REPLACE VIEW Epic_Top_Rated_Restaurants AS
        SELECT Restaurant_Name, R_Rating, City, Area
        FROM RESTAURANT R
        JOIN LOCATION L ON R.LocationID = L.Location_ID
        WHERE R.R_Rating >= 4.5
        ORDER BY R.R_Rating DESC;


CREATE OR REPLACE VIEW Insightful_Pending_Deliveries AS
SELECT 
    O.Order_ID, 
    O.Order_Status, 
    D.DeliveryType, 
    B.Branch_Name
FROM ORDERS O
JOIN ORDER_PAYMENT OP ON O.Order_ID = OP.Order_ID
JOIN BRANCH_1 B ON O.Cust_ID IS NOT NULL  
JOIN DELIVERY D ON D.Branch_ID = B.Branch_ID
WHERE O.Order_Status = 'Pending';

CREATE OR REPLACE VIEW Prime_Customer_Spend_Analysis AS
        SELECT C.Cust_ID, SUM(O.Total_Amount) AS Total_Spent
        FROM CUSTOMER C
        JOIN ORDERS O ON C.Cust_ID = O.Cust_ID
        GROUP BY C.Cust_ID
        ORDER BY Total_Spent DESC;

CREATE OR REPLACE VIEW Dynamic_Active_USERS_With_Orders AS
        SELECT DISTINCT U.User_ID, U.User_Name
        FROM USER_ U
        JOIN CUSTOMER C ON U.User_ID = C.User_ID
        JOIN ORDERS O ON C.Cust_ID = O.Cust_ID;

CREATE OR REPLACE VIEW Stellar_High_Value_Orders AS
        SELECT Order_ID, Total_Amount, Payment_Status
        FROM ORDERS
        WHERE Total_Amount >= 200
        ORDER BY Total_Amount DESC;


CREATE OR REPLACE VIEW View_Staff_By_Branch AS
SELECT 
    B.Branch_Name,
    E.Emp_ID,
    E.Position,
    E.Working_hour,
    E.Available_hour
FROM EMPLOYEE E
JOIN BRANCH_1 B ON E.Branch_ID = B.Branch_ID;

CREATE OR REPLACE VIEW Insightful_Branch_Capacity_Overview AS
        SELECT Branch_ID, Branch_Name, Available_hour
        FROM BRANCH_1
        ORDER BY Available_hour DESC;

CREATE OR REPLACE VIEW Stellar_Employee_Utilisation AS
        SELECT Emp_ID, Position, Working_hour, Available_hour,
               ROUND((Working_hour/Available_hour)*10, 2) AS Utilisation_Percent
        FROM EMPLOYEE
        WHERE Available_hour > 0;

CREATE OR REPLACE VIEW View_Branch_Menu_Insight_Filtered AS
SELECT 
    B.Branch_ID,
    B.Branch_Name,
    M.Menu_ID,
    M.Menu_Name,
    M.Category
FROM BRANCH_1 B
JOIN MENU M ON B.Branch_ID = M.Restaurant_ID
WHERE M.Category IN ('Snacks', 'Dessert');


CREATE OR REPLACE VIEW Prime_Revenue_By_Location AS
        SELECT L.City, L.Area, SUM(O.Total_Amount) AS Total_Revenue
        FROM ORDERS O
        JOIN CUSTOMER C ON O.Cust_ID = C.Cust_ID
        JOIN RESTAURANT R ON C.NotificationID = R.Restaurant_ID
        JOIN LOCATION L ON R.LocationID = L.Location_ID
        GROUP BY L.City, L.Area
        ORDER BY Total_Revenue DESC;

CREATE OR REPLACE VIEW Elite_Customer_Notification_Status AS
        SELECT CN.Cust_ID, N.NotificationName, CN.ReadStatus, CN.ReadAt
        FROM CUSTOMER_NOTIFICATION CN
        JOIN NOTIFICATION N ON CN.NotificationID = N.NotificationID;

CREATE OR REPLACE VIEW Elite_Restaurant_Branch_Map AS
        SELECT R.Restaurant_Name, B.Branch_Name, L.City, L.Area
        FROM RESTAURANT R
        JOIN BRANCH_2 B ON R.Branch_ID = B.Branch_ID
        JOIN LOCATION L ON B.Location_ID = L.Location_ID;


